import streamlit as st
import pandas as pd
import numpy as np
import plotly.graph_objs as go
import yfinance as yf
import joblib
from sklearn.preprocessing import MinMaxScaler
from datetime import datetime
from streamlit_option_menu import option_menu

# Set the page title
st.set_page_config(page_title="Time Series Analysis")


# Load the trained LSTM model
model = joblib.load('lstm_model.pkl')

# Function to fetch stock image URL based on ticker
def get_stock_image_url(ticker):
    image_urls = {
        "AAPL": "data:image/png;base64,",
        "GOOGL": "data:image/png;base64,",
        "MSFT": "data:image/png;base64,",
        "NVDA" : "data:image/png;base64,",
        "AMZN" : "data:image/png;base64,",
        "META" : "data:image/png;base64,",
        "TSLA" : "data:image/jpeg;base64,",
        "GS" : "data:image/png;base64,",
        "NFLX" : "data:image/png;base64,"
        
    }
    return image_urls.get(ticker.upper(), "https://example.com/default-logo.jpg")

# Streamlit application
def main():
    st.title("Stock Price Prediction Application")

    # Sidebar for navigation with option menu
    with st.sidebar:
        selected = option_menu(
            menu_title="Main Menu",
            options=["Predict Stock Price", "About"],
            icons=["bar-chart-line", "info-circle"],
            default_index=0,
            styles={
                "container": {"padding": "5px", "background-color": "#4D4D4D"},
                "icon": {"color": "orange", "font-size": "20px"},
                "nav-link": {"font-size": "16px", "text-align": "left", "margin": "5px", "--hover-color": "#eee"},
                "nav-link-selected": {"background-color": "#d3d3d3"},
            }
        )

    if selected == "Predict Stock Price":
        # Input for stock symbol
        ticker = st.text_input("Enter the stock symbol (e.g., AAPL for Apple):")

        # Input for date range
        start_date = st.date_input("Start date", value=datetime(2020, 1, 1))
        end_date = st.date_input("End date", value=datetime.now())

        # Slider for number of days to forecast
        forecast_periods = st.slider("Number of days to forecast:", min_value=1, max_value=10, value=2)

        if st.button("Fetch Data"):
            if ticker:
                # Fetch stock data
                data = yf.download(ticker, start=start_date, end=end_date)
                st.write(f"Data for {ticker}")
                st.write(data.tail())

                # Prepare data for prediction
                scaler = MinMaxScaler()
                scaled_data = scaler.fit_transform(data['Close'].values.reshape(-1, 1))

                n_steps = 10
                X = []
                for i in range(len(scaled_data) - n_steps):
                    X.append(scaled_data[i:i+n_steps])
                X = np.array(X)

                # Forecast with LSTM model
                forecast = []
                last_sequence = X[-1]
                for _ in range(forecast_periods):
                    pred = model.predict(last_sequence.reshape((1, n_steps, 1)))
                    forecast.append(pred[0, 0])
                    last_sequence = np.append(last_sequence[1:], pred[0, 0])
                forecast = scaler.inverse_transform(np.array(forecast).reshape(-1, 1))

                # Create forecast dates
                forecast_dates = pd.date_range(start=data.index[-1] + pd.Timedelta(days=1), periods=forecast_periods, freq='B')

                # Display the predicted prices with dates
                st.write("### Predicted Prices:")
                forecast_df = pd.DataFrame({
                    'Date': forecast_dates,
                    'Predicted Price': forecast.flatten()
                })

                # Display the data table and image side by side
                col1, col2 = st.columns([3, 2])
                with col1:
                    st.write(forecast_df)
                with col2:
                    image_url = get_stock_image_url(ticker)
                    st.image(image_url, caption=f"{ticker} Logo", use_column_width=True)

                # Plot actual vs predicted
                fig = go.Figure()
                fig.add_trace(go.Scatter(
                    x=data.index[-len(X):],
                    y=scaler.inverse_transform(X[:, -1, 0].reshape(-1, 1)).flatten(),
                    mode='lines',
                    name='Actual'
                ))
                fig.add_trace(go.Scatter(
                    x=forecast_dates,
                    y=forecast.flatten(),
                    mode='markers+lines',  # Scatter and lines
                    name='Predicted'
                ))
                fig.update_layout(
                    title='Actual vs Predicted Prices',
                    xaxis_title='Date',
                    yaxis_title='Price'
                )
                st.plotly_chart(fig)
            else:
                st.warning("Please enter a valid stock symbol.")
    
    elif selected == "About":
        st.write("This application uses an LSTM model to predict stock prices based on historical data.")
        st.write("You can enter a stock symbol, select a date range, and choose the number of days to forecast.")
        st.write("The model will then provide predictions and plot the actual vs predicted prices.")

if __name__ == '__main__':
    main()
